{
"connections":{
"disable_by":"",
"hide_by":"",
"value":"$T"
},
"metaData":{
"color_false":{
"desc":"The color of OFF, FALSE state.",
"type":"color"
},
"color_true":{
"desc":"The color of ON, TRUE state.",
"type":"color"
},
"connections":{
"disable_by":{
"desc":"If non-zero the component is disabled and data are no longer updated.",
"optional":true
},
"hide_by":{
"desc":"If non-zero the component is hidden.",
"optional":true
},
"value":{
"desc":"Datapoint from which the LED state is read.",
"order":"01",
"prev":[
"STATUS"
]
}
},
"desc":"Boolean state indicator with text label. Empty or Zero mean OFF,FALSE (<b>OK</b> text) otherwise ON, TRUE (<b>NG</b> text). This can be switched using <code>reverseMeaning</code> parameter.",
"label_false":{
"desc":"The label for OFF, FALSE state.",
"type":"string"
},
"label_true":{
"desc":"The label for ON, TRUE state.",
"type":"string"
},
"reverseMeaning":{
"desc":"If True the meaning of the value is switched. So the ON state is False and OFF state is True.",
"type":"bool"
}
},
"options":{
"color_false":"#00ff00",
"color_true":"#ff0000",
"label_false":"UVA LAMP ON",
"label_true":"UVA LAMP OFF",
"reverseMeaning":"False"
}
}

